const images = $input.item.json.body.images;

return images.map(image => {
  // Extract mime type and base64 data from data URI
  const match = image.data.match(/^data:image\/(\w+);base64,(.+)$/);

  if (!match) {
    throw new Error(`Invalid image data format for ${image.id}`);
  }

  const fileType = match[1];  // "jpeg", "png", "webp", etc.
  const base64Data = match[2]; // Clean base64 without prefix

  return {
    json: {
      id: image.id,
      base64: base64Data,
      fileType: fileType,
      fileName: image.fileName
    }
  };
});

// Helper function to convert to title case
function toTitleCase(str) {
  return str.toLowerCase().split(' ').map(word => {
    return word.charAt(0).toUpperCase() + word.slice(1);
  }).join(' ');
}

// Collect all books from all items
const allBooks = [];

$input.all().forEach(item => {
  // The aggregator wraps books in a 'data' array
  if (item.json.data && Array.isArray(item.json.data)) {
    item.json.data.forEach(book => {
      allBooks.push(book);
    });
  }
});

// Deduplicate by title + author combination
const uniqueBooks = [];
const seen = new Set();

allBooks.forEach(book => {
  // Safety check: ensure title and author exist
  const title = book.title || "Unknown Title";
  const author = book.author || "Unknown Author";

  const key = `${title.toLowerCase()}|${author.toLowerCase()}`;
  if (!seen.has(key)) {
    seen.add(key);
    uniqueBooks.push({
      title: toTitleCase(title),
      author: toTitleCase(author) // Now title casing author names too
    });
  }
});

// Sort alphabetically by title
uniqueBooks.sort((a, b) => a.title.localeCompare(b.title));

// Format final response for webpage
return [{
  json: {
    success: true,
    books: uniqueBooks,
    metadata: {
      totalBooks: uniqueBooks.length,
      imagesProcessed: 1,
      processingTime: "N/A"
    }
  }
}];

// Extract and parse the JSON from GPT-5-mini's response
const gptResponse = $input.item.json;

// GPT-5-mini wraps response in array, get first item
const responseData = Array.isArray(gptResponse) ? gptResponse[0] : gptResponse;

// Find the message output (type: "message") in the output array
const messageOutput = responseData.output.find(item => item.type === 'message');

// Get the text content from the first content item
const textContent = messageOutput.content[0].text;

// Remove ```json wrapper if present
const cleanJson = textContent.replace(/^```json\n?/, '').replace(/\n?```$/, '');
const parsed = JSON.parse(cleanJson);

// Return books array with simplified structure
return parsed.books.map(book => ({
  json: {
    title: book.title || "Unknown Title",
    author: book.author || "Unknown Author"
  }
}));

